                imageUrl: 'https://i.ibb.co/GCCdy8t/womens.png',
                size: 'large',
                id: 4,
                linkUrl: ''
            },
            {
                title: 'mens',
                imageUrl: 'https://i.ibb.co/R70vBrQ/men.png',
                size: 'large',
                id: 5,
                linkUrl: ''
            }
            ]
        };
    }

    render() {
        return (
            <div className="directory-menu" >
                {this.state.sections.map(({ title, imageUrl, id, size }) => (
                    < MenuItem key = {
                        id
                    }
                    title = {
                        title
                    }
                    imageUrl = {
                        imageUrl
                    }
                    size = {
                        size
                    }
                    history / >
                )
                )}
            </div>
        );
    }
}


export default Directory
